// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import PacjentList from './components/Pacjent/PacjentList';
import PacjentDetail from './components/Pacjent/PacjentDetail';
import LekarzList from './components/Lekarz/LekarzList';
import LekarzDetail from './components/Lekarz/LekarzDetail';
import GabinetList from './components/Gabinet/GabinetList';
import GabinetDetail from './components/Gabinet/GabinetDetail';
import WizytaList from './components/Wizyta/WizytaList';
import WizytaDetail from './components/Wizyta/WizytaDetail';

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/">Strona Główna</Link></li>
            <li><Link to="/pacjenci">Pacjenci</Link></li>
            <li><Link to="/lekarze">Lekarze</Link></li>
            <li><Link to="/gabinety">Gabinety</Link></li>
            <li><Link to="/wizyty">Wizyty</Link></li>
          </ul>
        </nav>

        <hr />

        <Route path="/" exact component={Home} />
        <Route path="/pacjenci" exact component={PacjentList} />
        <Route path="/pacjenci/:id" component={PacjentDetail} />

        <Route path="/lekarze" exact component={LekarzList} />
        <Route path="/lekarze/:id" component={LekarzDetail} />

        <Route path="/gabinety" exact component={GabinetList} />
        <Route path="/gabinety/:id" component={GabinetDetail} />

        <Route path="/wizyty" exact component={WizytaList} />
        <Route path="/wizyty/:id" component={WizytaDetail} />
      </div>
    </Router>
  );
};

const Home = () => (
  <div>
    <h2>Strona Główna</h2>
    <p>Witaj w aplikacji obsługującej pacjentów, lekarzy, gabinety i wizyty.</p>
  </div>
);

export default App;
